import pandas as pd

df = pd.DataFrame({'ten':[10,20,30,40,50],'one':[1,-2,-4,5,6]})
df

for i in range(len(df)):
  if df.iloc[i,1] < 0:# [rows: column]
    df.iloc[i,1]=0 # 음수일 경우: 0으로 변환, 음수가 아닐 때는 그대로 출력.
df

"""![image.png](data:image/png;base64,)"""

def relu(value):
  if value <0:
    value =0
  return value

sr1 = df.one.apply(relu)
sr1
# df.one은 데이터프레임 df의 'one'이라는 열(column)을 나타냅니다. df.one.apply(relu)는 해당 열의 각 원소에 함수 relu를 적용하는 코드입니다.
#여기서 relu는 Rectified Linear Unit의 약자로, 일반적으로 신경망과 같은 머신러닝 모델에서 사용되는 활성화 함수 중 하나입니다.

#relu 함수는 입력이 양수인 경우 그대로 반환하고, 음수인 경우 0으로 만드는 함수입니다.

sr1=df.ten.apply(lambda x:x*3-4) #  x: 매개변수,x*3-4:리턴값. -> 한번 쓰고 버릴 때 relu를 사용함.
sr1

# 여러개의 데이터 프레이을 합칠 때.
df1 = pd.DataFrame({'a':['a0','a1','a2','a3'],'b':['b0','b1','b2','b3'],'c':['c0','c1','c2','c3']} ,index= [0,1,2,3])
df1

df2 = pd.DataFrame({'a':['a2','a3','a4','a5'],'b':['b2','b3','b4','b5'],'c':['c2','c3','c4','c5'],'d':['d2','d3','d4','d5']} ,index= [2,3,4,5])
df2

result1= pd.concat([df1,df2])
result1

"""concat()

![image.png](data:image/png;base64,)

![image.png](data:image/png;base64,)
"""

result1= pd.concat([df1,df2],ignore_index=True) # 인덱스를 무시하라는 의미.
result1

result1= pd.concat([df1,df2])
result1.reset_index(drop=True, inplace=True) # ignore_index=True (: 원래 있던 인덱스 무시하고 붙임) 와 같은 의미.
result1

"""![image.png](data:image/png;base64,)"""

result2 = pd.concat([df1,df2],axis='columns',join='inner') # 같은 인덱스 찾아서 이어붙여줌. # join='outer' 합집합 # join='inner' 교집합
result2

"""join='outer':
이 옵션은 외부(outer) 결합을 의미합니다. 외부 결합은 두 데이터프레임의 모든 행을 포함하는 결과를 생성합니다.

만약 한 쪽 데이터프레임에 해당하는 값이 없는 경우에는 NaN(결측치)으로 채워집니다.


***데이터프레임은 두 데이터프레임의 행 인덱스를 모두 포함하게 됩니다.

![image.png](data:image/png;base64,)
"""

df = pd.read_csv('./datasets/titanic.csv')
df

df = df.loc[:,['Age','Sex','Pclass','Fare','Survived']]
df.head() # 이렇게 하면 5개만 나온다.

print(df['Pclass'].unique())
print(df['Pclass'].value_counts()) #  판다스(Pandas) 시리즈(Series)에서 각 고유한 값의 등장 횟수를 세는 데 사용되는 함수입니다.

"""# 대신, 그룹 및 해당 인덱스에 대한 정보가 표시되며, 이는 GroupBy 객체의 특별한 뷰로 볼 수 있습니다."""

grouped = df. groupby(['Pclass'])
print(grouped)

"""![image.png](data:image/png;base64,)"""

grouped_df = {}
for key, group in grouped: # grouped 에 들어있는 것을 하나하나 꺼내보면 됨. -> 여기서 grouped는 Pclass를 추가한 그룹.
  print('key',key)
  print('length',len(group))
  grouped_df[key]= group #grouped_df[key] : key 값 주고 = group: 요소주고.
  print(group.head()) # key는 unique 값, key와 데이터 프레임이 들어있어.

