isin_filter = titanic['SibSp'].isin([2,4,5]) # 동승자 수가 2,4,5와 겹치면 True, 안 겹치면 False
isin_filter

"""이 코드는 데이터프레임 titanic의 'SibSp' 열에 대해 값이 2, 4, 5 중 하나인지를 확인하는 불리언 필터인 isin_filter를 생성합니다. isin_filter는 'SibSp' 열의 각 행에 대해 해당 값이 2, 4, 5 중 하나이면 True를 반환하고, 그렇지 않으면 False를 반환합니다.



이 필터를 통해 데이터프레임을 필터링하면 'SibSp' 열 값이 2, 4, 5인 행들만 선택할 수 있습니다.

![image.png](data:image/png;base64,)
"""

df_isin = titanic[isin_filter]
df_isin

